html {
    height: 100%;
    overflow: hidden;
    font-size: 15px;
}
/* width */
::-webkit-scrollbar {
    width: 0.6rem;
}

/* Track */
::-webkit-scrollbar-track {
    border-radius: 0.7rem;
    background: rgba(0, 0, 0, 0.0);
}

/* Handle */
::-webkit-scrollbar-thumb {
    background: #141c2818; 
    border-radius: 0.7rem;
}

/* Handle on hover */
::-webkit-scrollbar-thumb:hover {
    background: #141c2838; 
}
body {
    margin:0;
    padding:0;
    box-sizing: border-box;
    color: #fff;
    perspective: 1px;
    transform-style: preserve-3d;
    height: 100%;
    overflow-y: scroll;
    overflow-x: hidden;
    font-family: 'Montserrat', sans-serif;
    scroll-behavior: smooth;
    position: relative;
    width: 100vw;
    scrollbar-width: thin;
    scrollbar-color: #141c289c rgba(0, 0, 0, 0.0);
    font-size: 15px;
}
h2 {
    margin: 0;
}
header {
    margin-top: -100vh;
    position: sticky;
    left: 0;
    right: 0;
    top: 0;
    display: flex;
    align-items: center;
    box-sizing: content-box;
    width: 100vw;
    z-index: 5;
    background-color: rgba(0, 0, 0, 0.7);
    border-bottom: 1px solid rgb(44, 44, 44);
    transition: background 200ms linear, height 200ms linear, transform 200ms linear;
    height: 6rem;
    transform: translateZ(0);
    -webkit-transform: translateZ(0);
}   
    .logo {
        font-size: 2rem;
        width: 50%;
        text-align: center;
        font-weight: 100;
        transition: transform 200ms linear;
        display: flex;
        align-items: center;
        justify-content: center;
    }
    .logo-image {
        width: 3rem;
        /* transform: translateX(3.5rem); */
        display: block;
        margin-right: 0.5rem;
    }
    /* .logo-caption {
        
    } */
    .logo-color {
        color: #69d8ee;
    }
    .navbar {
        display: flex;
        align-items: center;
        justify-self: flex-end;
        width: 50%;
        /* padding: 1rem; */
        text-align: center;
        justify-content: space-evenly;
        transition: transform 200ms linear;
    }
        .nav-item,
        .menu-item {
            list-style: none;
        }
            .nav-link,
            .nav-link:active,
            .nav-link:visited,
            .menu-link,
            .menu-link:active,
            .menu-link:visited {
                text-decoration: none;
                color: #fff;
                padding: 1rem;
                display: flex;
                align-items: center;
                flex-shrink: 1;
                white-space: nowrap;
                justify-content: center;
                position: relative;
            }
            .menu-link {
                display:none;
            }
            .after-link {
                position: absolute;
                top: 80%;
                left: 1rem;
                right: 1rem;
                height: 0.2rem;
                background-color: #fff;
                z-index: 10;
                transform: scale(0);
                transform-origin: left;
                transition: transform 150ms linear;
            }
            .after-scale {
                transform: scale(1);
            }


.paralax, .paralax::before {
    background: 50% 50% / cover;
}
.paralax {
    height: 100vh;
    padding-bottom: 4.2rem;
    position: relative;
    transform-style: inherit;
    width: 100vw;
    background-color: rgba(0, 0, 0, 0.7);
    z-index: 1;
    box-sizing: border-box;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
}
.paralax::before {
    content: "";
    bottom: 0;
    left: 0;
    right: 0;
    top: 0;
    position: absolute;
    display: block;
    background-image: url(../img/bg.jpg);
    background-size: cover;
    transform-origin: center center 0;
    transform: translateZ(-1px) scale(3);
    z-index: -1;
    min-height: 100vh;
    box-sizing: border-box;
}
.hero-paralax {
    
    display: flex;
    flex-direction: column;
    align-self: flex-start;
    padding-left: 10vw;
} 
    .paralax-desc {
        font-size: 1.5rem;
        width: 65vw;
        font-weight: 100;
        padding-top: 1.2em;
    }
    .paralax-title {
        font-size: 5rem;
        width: 65vw;
        text-align: start;
        font-weight: 200;
        text-transform: uppercase;   
        line-height: 0.9;
        margin: 0;
        padding: 1em 0;
        position: relative;
        /* -webkit-box-reflect: below -2em linear-gradient(transparent, #0004); */
    }
    .paralax-title::after {
        content:attr(data-text);
        width: inherit;
        position: absolute;
        ;
        left: 0;
        right: 0;
        bottom: -16%;
        transform: scaleY(-1);
        line-height: 0.85em;
        background: linear-gradient(0deg, #fff6 0, transparent 70%);
        background-clip: text;
        -webkit-background-clip: text;
        color: transparent;
        filter: blur(2px);
        /* opacity: 0.2; */
        /* font-style: italic; */
    }
section {
    position: relative;
    z-index: 1;
    box-sizing: border-box;
    display: flex;
    flex-wrap: wrap;
    width: 100vw;
    min-height: 100vh;
    align-items: center;
    justify-items: center;
    align-content: center;
    justify-content: space-evenly;
}
h2 {
    color: rgb(14, 32, 36);
    font-size: 3rem;
    font-weight: 200;
    text-align: center;
    width: 100vw;
    position: relative;
    margin-top: 6rem;
}
h2::after {
    content: '';
    position: absolute;
    top:150%;
    left: 50%;
    transform: translateX(-50%);
    width: 10vw;
    height: 0.25rem;
    background-color: #69d8ee;
} 
h3 {
    font-size: 2rem;
    font-weight: 200;
    margin: 1rem 0;
}
.about {
    background: #fff;
    color: #141c28cc;
    min-height: 110vh;
}
.about::before
{
    position: absolute;
    top: 0;
    content: "";
    display: block;
    height: 6rem;
    margin-top: -16rem;
    background-color: #fff;
    background-color: #141c28;
}
    .about-item {
        display: flex;
        flex-direction: column;
        align-items: center;
        justify-content: start;
        min-height: 35rem;
        min-width: 27rem;
    }
    .about-icon {
        min-height: 15vw;
        pointer-events: none;
    }
    .about-icon img {
        padding-top: 6rem;
        width: 7rem;
    }
    .about-content {
        padding: 1rem;
        width: 25rem;
        line-height: 2;
        font-size: 1.1rem;
        font-weight: 400;
        text-align: center;
    }
.skills {
    background-color: #141c28;
    color: #fff;
    justify-content: space-around;
    padding-left: 0.5rem;
    padding-right: 0.5rem;
}
    .skills-title {
        color: #fff;
    }
    .skills-image img {
        padding-top: 6rem;
        width: 25rem;
        pointer-events: none;
        animation: moveInOut 4000ms ease-in-out infinite;
    }
    .skills-image {
        opacity: 0.7;
        /* transform: skewY(-15deg); */
        transition: opacity 150ms linear;
        margin: 0 1rem;
    }
    .skills-image:hover {
        opacity: 1;
    }
    .skills-content {
        padding-top: 6rem;
        font-size: 1.3rem;
        margin: 0 1rem;
    }
        /* .skills-items {
            padding: 0;
            justify-content: center;
        } */
            .skills-item {
                display: flex;
                align-items: center;
                padding: 1rem;
            }
            .skills .fa-2x{
                margin-right: 1rem;
            }
    .skills-familiar {
        /* margin-top: 1rem; */
        padding: 1rem;
        font-size: 1.3rem;
        width: 100vw;
        display: flex;
        flex-direction: column;
        align-items: center;
        text-align: center;
    }
        .familiar-items {
            display: flex;
            width: 30rem;
            max-width: 90vw;
            flex-wrap: wrap;
            align-items: center;
            justify-content: center;
            padding: 0;
        }  
            .familiar-item {
                list-style: none;
                font-size: 1rem;
                padding: 0.4rem;
                border-radius: 0.3rem;
                border: 1px solid #69d8ee;
                margin: 0.5rem;
                font-weight: 200;
            }
.portfolio {
    background-color: #fff;
    color: #141c28;
    /* align-items: start; */
    padding-bottom: 6rem;
}

        .project-image {
            /* -webkit-box-shadow: 0px 0px 20px 0px rgba(0,0,0,0.15);
            -moz-box-shadow: 0px 0px 20px 0px rgba(0,0,0,0.15);
            box-shadow: 0px 0px 20px 0px rgba(0,0,0,0.15); */

            /* border-radius: 0.5rem; */
            transition: box-shadow 150ms linear;
            margin: 6rem 0 0 0;
            cursor: pointer;
            text-align: center;
            width: 30rem;
            /* height: 220px; */
            background-color: #fff;
        }
        
        .project-image img {
            width: 30rem;
        }
        .project-image .construction-image {
            width: 14.3rem;
        }
        .project-image:hover {
            -webkit-box-shadow: 0px 0px 20px 0px rgba(0,0,0,0.2);
            -moz-box-shadow: 0px 0px 20px 0px rgba(0,0,0,0.2);
            box-shadow: 0px 0px 20px 0px rgba(0,0,0,0.2);
        }
        /* .project-image:hover .image-caption {
            transform: translateY(0);
        } */
        .image-caption {
            border-radius: 0 0 50% 50%;
            /* border: 1px solid rgba(0, 0, 0, 0.7); */
            /* display: inline-block; */
            color: #fff;
            background-color: #141c28;
            padding: 1rem;
            margin: 0;
            text-align: center;
            /* transform: translateY(-100%);
            position: relative;
            z-index: -1;
            transition: transform 150ms ease-in; */
        }
        .project-holder {
            /* overflow-y: scroll;
            height: 80vh; */
            font-size: 14px;
            display:flex;
            justify-content: center;
            flex-wrap: wrap;
            /* flex-direction: column; */
            /* display: inline-block; */
            color: #141c28;
            /* margin-top: 6rem; */
            -webkit-box-shadow: 0px 0px 30px 0px rgba(0,0,0,0.13);
            -moz-box-shadow: 0px 0px 30px 0px rgba(0,0,0,0.13);
            box-shadow: 0px 0px 30px 0px rgba(0,0,0,0.13);
            align-items: center;
            width: 100%;
            
            /* border: 1px solid rgba(0, 0, 0, 0.1); */
        }
        .project-content {
            width: 30rem;
            padding: 1rem;
            font-weight: 400;
            line-height: 1.5;
            display: flex;
            flex-direction: column;
            justify-content: center;
            overflow-x: hidden;
        }
            .project-title {
                background-color: #141c28;
                color: #fff;
                display: inline-block;
                border-radius: 0.5rem;
                align-self: start;
                padding: 0 0.5rem;
            }
            .project-features {
                padding: 0 0 0 1rem;
                margin-top: 0.3rem;
                white-space: nowrap;
            }
                .project-feature {
                    list-style: none;
                }
            .project-technologies {
                padding: 0;
                display: flex;
                flex-wrap: wrap;
            }
                .project-technology {
                    list-style: none;
                    font-size: 1rem;
                    padding: 0.4rem;
                    border-radius: 0.3rem;
                    border: 1px solid #69d8ee;
                    margin: 0.5rem;
                    font-weight: 400;
                    color: #69d8ee;
                    background-color: #141c28;
                    -webkit-box-shadow: 0px 0px 20px 0px rgba(0,0,0,0.2);
                    -moz-box-shadow: 0px 0px 20px 0px rgba(0,0,0,0.2);
                    box-shadow: 0px 0px 20px 0px rgba(0,0,0,0.2);
                }
                .project-buttons {
                    display: flex;
                    justify-content: space-between;
                    width: 100%;
                    /* flex-wrap: wrap; */
                }
                .project-button {
                    outline-width: 1px;
                    outline-style: inset;
                    outline-color: rgba(0,0,0,0);
                    border: 1px solid #69d8ee;
                    border-radius: 1rem;
                    padding: 0.5rem;
                    margin: 0.5rem;
                    background-color: #fff;
                    color: #69d8ee;
                    /* min-width: 8rem; */
                    width: 40%;
                    /* font-weight: 600; */
                    font-size: 1.1rem;
                    cursor: pointer;
                    transition: background 150ms linear;
                    text-decoration: none;
                    text-align: center;
                }
                .project-button:hover {
                    background-color: #141c28;
                }

.contact {
    background-color: #141c28;
    /* background-color: #333; */
    color: #fff;
    align-self: center;
    justify-self: center;
    padding-bottom: 6rem;
}
    .contact-title {
        color: #fff;
    }
    .contact-info {
        margin-top: 6rem;
    }
        .info-item {
            display: flex;
            align-items: center;
            justify-content: start;
            width: 30rem;
            margin-bottom: 2rem;
        }
            .info-icon {
                margin-right: 5rem;
                padding:1.5rem;
                border: 1px solid #69d8ee;
                border-radius: 50%;
            }
            .info-content {
                display: flex;
                flex-direction: column;
                justify-content:center;
            }   
                .info-heading {
                    margin-bottom: 1rem;
                }
        .contact-social {
            display: flex;
            border-top: 1px solid #69d8ee;
            justify-content: space-between;
        }
            .social-item {
                list-style: none;
                margin-top: 2rem;
            }
                .social-link,
                .social-link:active, 
                .social-link:visited{
                    text-decoration: none;
                    color: #fff;
                    padding: 1rem;
                    transition: color 150ms linear;
                    display: block;
                }
                .social-link:hover {
                    color: #69d8ee;
                }
footer {
    display: flex;
    flex-direction: column;
    min-height: 40vh;
    justify-content: space-evenly;
    align-items: center;
    background-color: rgba(53,54,58,1);;
    color: rgb(180, 180, 180);
    padding: 1rem;
}   
    .footer-logo {
        width: 3rem;
    }
    .footer-link,
    .footer-link:active,
    .footer-link:visited {
        text-decoration: none;
        color: #fff;
        transition: color 150ms linear;
        padding: 0.5rem;
    }
    .footer-link:hover {
        color: #69d8ee;
        display: block;
    }                    
    a[data-tool-tip] {
        position:relative;
    }
    a[data-tool-tip]::before {
        content: attr(data-tool-tip);
        display: block;
        position: absolute;
        bottom: 100%;
        left: -170%;
        background-color: #333;
        border: 1px solid #69d8ee;
        color: inherit;
        /* white-space: nowrap; */
        padding: 0.5rem;
        border-radius: 0.4rem;
        transform: scale(0);
        transform-origin: bottom center;
        transition: transform 100ms ease-in;
        width: 9rem;
    }
    a[data-tool-tip]:hover::before {
        transform: scale(1);
    }
    footer p {
        text-align: center;
    }

.background {
    background-color: #000;
    height:4rem;
}
.background .logo {
    transform: translateX(-3rem);
}
.unclickable {
    pointer-events: none;
}
.no-scroll {
    overflow: hidden;
}
.perspective {
    perspective: none;
    transform-style: flat;
}
.disabled {
    pointer-events: none;
    opacity: 0.7;
}
.planning {
    padding: 0.1rem;
    border-radius: 0.2rem;
    background-color: #69d8ee;
    color: #141c28;
    border: 1px solid #141c28;
    margin-bottom: 1rem;
    display: inline-block;
}

/* ANIMATIONS */

@keyframes moveInOut {
    /* 0% {transform: translate(-1%, -1%) skewY(15deg);}
    50% {transform: translate(0%, 0%) skewY(15deg);}
    100% {transform: translate(-1%, -1%) skewY(15deg);} */

    0% {transform: translate(-2%, -2%);}
    50% {transform: translate(0%, 0%);}
    100% {transform: translate(-2%, -2%);}

    /* 0% {transform: scale(1) skewY(15deg);}
    50% {transform: scale(1.03) skewY(15deg);}
    100% {transform: scale(1) skewY(15deg);} */

    /* 0% {transform: scale(1);}
    50% {transform: scale(1.03);}
    100% {transform: scale(1);} */
}

/* POPUP */
.popup-overlay {
    position: fixed;
    top:0;
    left:0;
    width: 100%;
    height: 100%;
    z-index: 5;
    transition: opacity 150ms ease-in;
    pointer-events: none;
    opacity: 0;
    background-color: rgba(0, 0, 0, 0.9);
}
    .popup-div {
        border: 1px solid #141c28;
        padding: 1rem;
        position: fixed;
        /* max-width: 90vw; */
        top:50%;
        left:50%;
        transform: translate(-50%, -60%);
        background-color: #fff;
        transition: transform 150ms ease-in;
        border-radius: 1.5rem 0 1.5rem 1.5rem;
        z-index: 21;
    }
        .popup-div-content {
            overflow-y: auto;
            max-width: 80vw;
            z-index: 5;
            max-height: 80vh;
            scrollbar-width: thin;
            scrollbar-color: #141c282a rgba(0, 0, 0, 0.0);
            /* display: flex;
            align-items: center; */
        }
        .popup-div-content img {
            max-width: 70vw;
        }
        .show-popup {
            pointer-events: auto;
            opacity: 1;
        }
        .show-popup .popup-div {
            transform: translate(-50%, -50%);
            /* transform: translateY(50px); */
        }
        .close-popup {
            position: absolute;
            bottom: 101%;
            right: 0;
            cursor: pointer;
            z-index: 10;
            color: #fff;
            transition: color 150ms linear;
        }
        .close-popup:hover {
            color: #69d8ee;
        }

/* SMALL SCREENS */

@media screen and (max-width: 1100px) {
    .logo {
        width: 20%;
    }
    .navbar {
        width: 80%;
    }
    .logo-caption {
        display: none;
    }
    .paralax-desc {
        font-size: 1.3rem;
    }
    .paralax-title {
        font-size: 3.5rem;
    }
    
}

@media screen and (max-width: 820px) {
    
    .hero-paralax {
        padding: 1rem;
        align-items: center;
    }
    .paralax-desc {
        width: 90vw;
        font-size: 3vw;
        text-align: center;
    }
    .paralax-title {
        width: 90vw;
        font-size: 8vw;
        text-align: center;
        align-self: flex-start;
    }
    .paralax-title::after {
        background: linear-gradient(0deg, #fff7 0, transparent 70%);
        background-clip: text;
        -webkit-background-clip: text;
        color: transparent;
        filter: blur(2px);
    }
    .logo {
        margin-left: 3rem;
        width: 80%;
    }
    .logo-caption {
        display: block;
    }
    .navbar {
        width: 20%;
    }
    .navbar .nav-item {
        display:none;
    }
    .menu-link {
        display: block;
    }
}

@media screen and (max-width: 600px) {
    html {
        font-size: 14px;
    }
    .paralax-desc {
        width: 70vw;
        font-size: 4vw;
    }
    .logo {
        margin-left: 5rem;
        width: 60%;
    }
    .navbar {
        width: 40%;
    }
    h2 {
        font-size: 2.5rem;
    }
    .paralax-title::after {
        background: linear-gradient(0deg, #fff8 0, transparent 70%);
        background-clip: text;
        -webkit-background-clip: text;
        color: transparent;
        filter: blur(2px);
    }
    .about-content {
        min-width: 90vw;
    }
}
@media screen and (max-width: 500px) {
    html {
        font-size: 13px;
    }
    h2 {
        font-size: 2.5rem;
    }
    .project-image,
    .project-image img {
        width: 90vw;
    }
    .paralax-title::after {
        background: linear-gradient(0deg, #fff9 0, transparent 80%);
        background-clip: text;
        -webkit-background-clip: text;
        color: #fff2;
        filter: blur(2px);
    }
}
@media screen and (max-width: 400px) {
    html {
        font-size: 12px;
    }
    .logo {
        margin-left: 5rem;
        width: 50%;
    }
    .navbar {
        width: 50%;
    }
    .paralax-desc {
        width: 85vw;
        font-size: 5vw;
    }
    .paralax-title {
        font-size: 9.5vw;
    }
    .paralax-title::after {
        background: linear-gradient(0deg, #fff 0, transparent 80%);
        background-clip: text;
        -webkit-background-clip: text;
        color: #fff2;
        filter: blur(2px);
    }
    .project-button {
        width: 8rem;
    }
    .contact-info {
        transform: scale(0.92);
        font-size: 1rem;
    }
    .info-value {
        font-size: 1.3rem;
    }
}

/* SIDE MENU NAVIGATION */
.menu-navbar-container {
    position:sticky;
    left: 0;
    top:0;
    bottom: 0;
    z-index:10;
    background-color: #141c28;
    background-color: rgba(0, 0, 0, 0.945);
    width: 80vw;
    height: 100vh;
    display: flex;
    align-items: center;
    justify-content: center;
    border-radius: 0 10rem 10rem 0;
    transform: translateX(-100%);
    transition: transform 150ms ease-in;
}
    .menu-navbar {
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
        height: 100%;
        padding: 0;
        width: 100%;
        border-radius: 0 10rem 10rem 0;
        border: 1px solid rgba(255, 255, 255, 0.205);
        border: 1px solid #fff;
        border-left: none;
    }
        .menu-nav-item {
            list-style: none;
            margin: 0.5rem auto;
        }
            .menu-nav-link,
            .menu-nav-link:active,
            .menu-nav-link:visited {
                padding: 1.5rem;
                text-decoration: none;
                color: #fff;
                font-size: 1.5rem;
                display: inline-block;
                position: relative;
            }
.show-menu {
    transform: translateX(0);
    
}
